			function craratline() {
				window.addEventListener("keydown", handlekeypress);
				var line = new createjs.Shape();
				if (whichstone == linejump.length) {
					whichstone--;
				}
				line.name = "theline";
				stage.addChild(line);
				line.graphics.setStrokeStyle(3).beginStroke("rgba(0,0,0,1)");
				line.graphics.moveTo(640, 266);
				line.graphics.lineTo(arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][3], arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][4]);
			}
		//פונקציית מקשים
			function handlekeypress(e) {
				if (e.keyCode == 37 || e.keyCode==39) {
					if (e.keyCode == 37) {
						if (whichstone > 0) {
							whichstone--;
						}
					}
					if (e.keyCode == 39) {
						if (whichstone < linejump.length - 1) {
							whichstone++;
						}
					}
					stage.removeChild(stage.getChildByName("theline"));
					var line = new createjs.Shape();
					line.name = "theline";
					stage.addChild(line);
					line.graphics.setStrokeStyle(3).beginStroke("rgba(0,0,0,1)");
					line.graphics.moveTo(640, 266);
					line.graphics.lineTo(arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][3], arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][4]);
				}
		
				if (e.keyCode == 38 || e.keyCode==32) {
					createjs.Sound.play("grab");
					window.removeEventListener("keydown", handlekeypress);
					movetox = (stage.getChildByName(linejump[whichstone]).x - 530) / 30;
					movetoy = (stage.getChildByName(linejump[whichstone]).y - 265) / 30;
					var movestoneint = setInterval(movestone, 60);
					var stonenum = 0;
					linex = arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][3];
					liney = arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][4];
					lineminusx = (640 - (arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][3])) / 27
					lineminusy = (266 - (arraypos[(myq[gamenum][qunum][1].length) - 1][linejump[whichstone]][4])) / 27
					function movestone() {
						if (stonenum < 30) {
							stage.removeChild(stage.getChildByName("theline"));
							stage.getChildByName(linejump[whichstone]).x -= movetox;
							stage.getChildByName(linejump[whichstone]).y -= movetoy;
							stage.removeChild(stage.getChildByName("theline"));
							var line = new createjs.Shape();
							line.name = "theline";
							line.graphics.setStrokeStyle(3).beginStroke("rgba(0,0,0,1)");
							line.graphics.moveTo(640, 266);
							linex += lineminusx;
							liney += lineminusy;
							if (liney > 266) {
								line.graphics.lineTo(linex, liney);
								stage.addChild(line);
							}
		
							stonenum++;
						} else {
							clearInterval(movestoneint);
							if(stage.getChildByName(linejump[whichstone]).getChildAt(2).name==null){
								var theforq=stage.getChildByName(linejump[whichstone]).getChildAt(5).name.charAt(0)
							}
							else{
								var theforq=stage.getChildByName(linejump[whichstone]).getChildAt(2).name.charAt(0)
							}
							if (ifcorrect(theforq)) { //תשובה נכונה
								stage.getChildByName(linejump[whichstone]).gotoAndStop(1);
								stage.getChildByName(linejump[whichstone]).x = trueposx;
								stage.getChildByName(linejump[whichstone]).y = falsepos;
								stage.getChildByName(linejump[whichstone]).scale = 0.3;
								stage.getChildByName(linejump[whichstone]).addEventListener("mouseover", stoneover);
								stage.getChildByName(linejump[whichstone]).addEventListener("mouseout", stoneout);
								trueposx -= 73;
								createjs.Sound.play("correct");
								rightanswer++
								stage.getChildByName("bgGame").imfinish.alpha=1;
								linejump.splice(whichstone, 1);
									craratline()
								
							} else { //תשובה שגויה
								createjs.Sound.play("incorrect");
								stage.getChildByName(linejump[whichstone]).x = trueposx;
								stage.getChildByName(linejump[whichstone]).y = falsepos;
								stage.getChildByName(linejump[whichstone]).scale = 0.3;
								stage.getChildByName(linejump[whichstone]).gotoAndStop(2);
								trueposx -= 73;
								stage.getChildByName(linejump[whichstone]).addEventListener("mouseover", stoneover);
								stage.getChildByName(linejump[whichstone]).addEventListener("mouseout", stoneout);
								var nextbtn = new lib.incorrectmsg();
								nextbtn.nxtbtn.addEventListener("click",nextqfunc)
								myq[gamenum][qunum][0][2]+=1;
								nextbtn.x = nextbtnX;
								nextbtn.y = nextbtnY;
								stage.addChild(nextbtn);
								clearInterval(firebombinterval);
								stage.getChildByName("firebomb").gotoAndStop(0);
								window.removeEventListener("keydown", handlekeypress);
								stage.getChildByName("bgGame").imfinish.removeEventListener("click",imfinishfunc)
								stage.getChildByName("bgGame").pause.removeEventListener("click",pausegame)
		
							}
						}
					}
				}
			}
